interface SquareProps {
  piece?: string;
  color: string;
}

const Square: React.FC<SquareProps> = ({ piece, color }) => {
  return (
    <div
      style={{
        width: "60px",
        height: "60px",
        backgroundColor: color,
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      {piece && (
        <img
          src={piece}
          alt=""
          style={{ width: "48px", height: "48px" }}
        />
      )}
    </div>
  );
};

export default Square;
